import Quote from "./Quote";
import { useState } from "react";




const QuoteList = () => {
    const [quotes, setQuotes] = useState([
        {quote: "tässä quote 1"},
        {quote: "tässä quote 2"},
        {quote: "tässä quote 2"},
    ])
    return (
        <div>
        <pre>{JSON.stringify(quotes, null, 2)}</pre>
        <Quote quote="tässä 1 quote" />

        
        </div>
    )
}

export default QuoteList;
